import { Component, OnInit, AfterViewInit, ViewChild, ElementRef, OnDestroy } from '@angular/core';
import { QuestionService } from "../../service/question.service";
import { interval } from "rxjs";
import CreativeEditorSDK, { Configuration } from '@cesdk/cesdk-js';

@Component({
  selector: 'app-body-interaccion',
  templateUrl: './body-interaccion.component.html',
  styleUrls: ['./body-interaccion.component.css']
})
export class BodyInteraccionComponent implements OnInit, AfterViewInit, OnDestroy {
  @ViewChild('cesdk_container') containerRef: ElementRef = {} as ElementRef;
  selectedPanel: number | null = null;
  vocabclick1: boolean = false;
  vocabclick2: boolean = false;
  vocabclick3: boolean = false;
  click3 = 0;
  cont = false;
  cont2 = false;
  cont3 = false;
  public nameStudent: String = "";
  public questionList: any = [];
  public currentQuestion: number = 0;
  public currentlienzo: number = 0;
  public points: number = 0;
  counter = 120;
  correctAnswer: number = 0;
  inCorrectAnswer: number = 0;
  interval$: any;
  progress: string = "0";
  isQuizCompleted: boolean = false;
  qscli: boolean = false;
  hasAnswered: boolean = false;
  //el back me dara este valor
  jsonConvertido: string = "";

  public jsonDecodificado: any = "";



  config: Configuration = {
    locale: 'es',
    i18n: {
      es: {
        "input.page.titleTemplate": "",
      }
    },
    role: "Viewer",
    callbacks: { onUpload: "local" },
    ui: {
      elements: {
        view: "advanced",
        navigation: {
          show: false,
          action: {
            close: false,
            back: false,
            load: false,
            save: false,
            export: {
              show: false,
              format: ["application/pdf"]
            },
            download: false,
            custom: [
              {
                label: "common.custom",
                iconName: "default",
                callback: () => { }
              }
            ]
          }
        },
        dock: {
          iconSize: "normal",
          hideLabels: false,
          groups: [
            {
              id: "ly.img.template",
              entryIds: ["ly.img.template"]
            },
            {
              id: "ly.img.defaultGroup",
              showOverview: false
            }
          ],
          defaultGroupId: "ly.img.defaultGroup"
        },
        libraries: {
          insert: {
            entries: (defaultEntries) => defaultEntries,
            floating: false,
            autoClose: false
          },
          replace: {
            entries: (defaultEntries) => defaultEntries,
            floating: false,
            autoClose: false
          }
        },
        panels: {
          inspector: {
            show: false
          },
          assetLibrary: {
            show: false
          },
          settings: {
            show: false
          }
        },
        blocks: {
          opacity: false,
          transform: false,
          "//ly.img.ubq/image": {
            adjustments: false,
            filters: false,
            effects: false,
            blur: false,
            crop: false
          },
          "//ly.img.ubq/page": {
            manage: true,
            format: true,
            maxDuration: 30 * 60
          }
        }
      }
    }
  };

  private instance: any;

  constructor(private questionService: QuestionService) {}

  ngOnInit(): void {
    //this.questionList[this.currentlienzo]?.lienzo;
    this.nameStudent = localStorage.getItem("nameStudent")!;
    this.getAllQuestions();
    this.startCounter();
    this.desconvertirCadenaAJson();
  }

  ngAfterViewInit() {
    this.initializeCreativeEditor();
  }

  ngOnDestroy() {
    // Limpieza de CreativeEditorSDK
    if (this.instance && this.instance.destroy) {
      this.instance.destroy();
    }
  }

  private async initializeCreativeEditor() {
    // Limpiar el contenedor antes de crear un nuevo lienzo
    this.containerRef.nativeElement.innerHTML = '';

    // Asigna la instancia actual a la propiedad 'instance'
    this.instance = await CreativeEditorSDK.create(this.containerRef.nativeElement, this.config);

    await this.instance.addDefaultAssetSources();
    await this.instance.addDemoAssetSources({ sceneMode: "Design" });
    this.instance.engine.scene.loadFromString(this.jsonDecodificado.questions[this.currentlienzo]?.lienzo);
    //this.instance.engine.scene.loadFromString(this.questionList[this.currentlienzo]?.lienzo);

  }

  desconvertirCadenaAJson() {
    if (this.jsonConvertido) {
      const decodedString = atob(this.jsonConvertido);
      this.jsonDecodificado = JSON.parse(decodedString);
      console.log('Contenido codificado en base64:', this.jsonConvertido);
      console.log('Contenido decodificado:', this.jsonDecodificado);
      //this.jsonDecodificado.questions[this.currentQuestion]?.lienzo
      console.log('lienzo descodificado: 5', this.jsonDecodificado.questions[4]?.lienzo);
    }
    else {
      console.log('revisar');
    }
  }

  togglePanel(panel: number) {
    if (this.selectedPanel === panel) {
      this.selectedPanel = null;
    } else {
      this.selectedPanel = panel;
    }
  }

  clickv1() {
    if (!this.vocabclick1) {
      this.click3 = 1;
      this.vocabclick1 = true;
      this.vocabclick2 = false;
      this.vocabclick3 = false;
    } else {
      this.vocabclick1 = false;
      this.click3 = 0;
    }
  }

  clickv2() {
    if (!this.vocabclick2) {
      this.click3 = 2;
      this.vocabclick1 = false;
      this.vocabclick2 = true;
      this.vocabclick3 = false;
    } else {
      this.vocabclick2 = false;
      this.click3 = 0;
    }
  }


  getAllQuestions() {
    this.questionService.getQuestionJson()
      .subscribe(res => {
        this.questionList = res.questions;
      });
  }

  qsValide() {
    this.qscli = false;
  }

  nextQuestion() {
    this.currentQuestion++;
    this.jsonDecodificado.questions[this.currentlienzo+1].lienzo
    this.vocabclick1 = false;
    this.click3 = 0;
    //this.questionList[this.currentlienzo + 1].lienzo;
    this.initializeCreativeEditor();
    this.currentlienzo++;
    this.hasAnswered = false;
    this.qscli = false;
    this.getProgressPorcent();
    if (!this.qscli) {
      this.inCorrectAnswer++;
    }
    if (this.currentQuestion === this.questionList.length) {
      this.isQuizCompleted = true;
      this.stopCounter();
    }
  }

  previusQuestion() {
    this.currentQuestion--;
    this.getProgressPorcent();
  }

  answer(currentQno: number, option: any) {
    this.getProgressPorcent();
    if (option.correct) {
      if (!this.cont3){
        if (!this.cont){
          this.points += 4;
          this.correctAnswer++;
          this.cont=true;
          this.cont3=true;
          console.log("Preguntas correctas:",this.correctAnswer)
          console.log("Preguntas incorrectas:",this.inCorrectAnswer)
        } else {
          this.points -= 4;
          this.correctAnswer--;
          this.cont=false;
          this.cont3=false;
          console.log("Preguntas correctas:",this.correctAnswer)
          console.log("Preguntas incorrectas:",this.inCorrectAnswer)
        }
      }

    }
    if (!option.correct) {
      if (!this.cont3){
        if (!this.cont2){
          this.inCorrectAnswer++;
          this.cont2=true;
          this.cont3=true;
          console.log("Preguntas correctas:",this.correctAnswer)
          console.log("Preguntas incorrectas:",this.inCorrectAnswer)
        } else {
          this.inCorrectAnswer--;
          this.cont2=false;
          this.cont3=false;
          console.log("Preguntas correctas:",this.correctAnswer)
          console.log("Preguntas incorrectas:",this.inCorrectAnswer)
        }
      }


    }

    if (currentQno === this.questionList.length) {
      setTimeout(() => {
        this.isQuizCompleted = true;
      }, 1000);
      this.stopCounter();
    }
  }

  startCounter() {
    this.qscli = false;
    this.interval$ = interval(1000)
      .subscribe(val => {
        this.counter--;
        if (this.counter === 0) {
          this.nextQuestion();
          this.getProgressPorcent();
          this.counter = 120;
          this.points -= 0;
          if (this.currentQuestion === this.questionList.length) {
            this.isQuizCompleted = true;
            this.stopCounter();
          }
        }
      });
    setTimeout(() => {
      this.interval$.unsubscribe();
    }, 600000);
  }

  stopCounter() {
    this.interval$.unsubscribe();
    this.counter = 0;
  }

  resetCounter() {
    this.stopCounter();
    this.counter = 120;
    this.startCounter();
  }

  resetQuiz() {
    //this.resetCounter();
    this.getAllQuestions();
    this.points = 0;
    this.counter = 120;
    this.currentQuestion = 0;
    this.progress = "0";
  }

  getProgressPorcent() {
    this.progress = ((this.currentQuestion / this.questionList.length) * 100).toString();
    return this.progress;
  }

  updateProgress() {
    if (this.currentQuestion >= this.questionList.length) {
      this.isQuizCompleted = true;
      this.stopCounter();
    }
  }

  endQuiz() {
    if (!this.qscli) {
      this.inCorrectAnswer++;
    }
    this.isQuizCompleted = true;
  }
}
